    // .sort((a, b) => coinA.current_price > coinB.current_price ? 1 : -1)
    .sort(function (a, b) {
        return a.current_price - b.current_price;
      })

    console.log(sortedCoins)

    return(
        <CryptoList coins={sortedCoins} />
    )
}

